Une atrésie (du grec : a- privatif et trêsis : trou) décrit généralement une malformation congénitale menant à une pathologie anatomique qui se caractérise par la fermeture complète ou non d'un orifice ou d'un conduit d'un organisme. Elle peut être d'origine congénitale (variété d'aplasie) ou exceptionnellement acquise (phénomène d'apoptose). Exemples d'atrésie : 
*  atrésie de l'œsophage ; 
*  atrésie anus-rectum ; 
*  atrésie des voies biliaires qui touche un nouveau né sur 20 000 et est la cause la plus fréquente de l'ictère obstructive  ; 
*  atrésie trachéale ; 
*  atrésie aortique ; 
*  atrésie du canal déférent ; 
*  en médecine on parle aussi d'atrésie folliculaire pour la diminution physiologique (et non pathologique) du stock d'ovocytes (7 millions de follicules à 7 mois de vie embryonnaire pour un millier à la ménopause).
